import {combineReducers} from 'redux-immutable';
import {reducer as homeReducer} from '../pages/home/store';
import {reducer as detailReducer} from '../pages/newsdetail/store'
import {reducer as bookfiledetailReducer} from '../pages/bookfiledetail/store'
import {reducer as departmentdetailReducer} from '../pages/departmentdetail/store'
import {reducer as noticedetailReducer} from '../pages/noticedetail/store'
import {reducer as softwaredetailReducer} from '../pages/softwaredetail/store'
import {reducer as videodetailRouter} from '../pages/videodetail/store'
import {reducer as musicdetailRouter} from '../pages/musicdetail/store'
import {reducer as fivelvdetailRouter} from '../pages/fiveLv/store'
// import {reducer as qjsxdetailRouter} from '../pages/thinkingarmy/store'
import { reducer as picshowdetailRouter } from '../pages/picshowdetail/store'
const reducer = combineReducers({
	home: homeReducer,
	newsdetail:detailReducer,
	bookfiledetail:bookfiledetailReducer,
	departmentdetail:departmentdetailReducer,
	noticedetail:noticedetailReducer,
	softwaredetail:softwaredetailReducer,
	videodetail:videodetailRouter,
	musicdetail:musicdetailRouter,
	fivelvdetail:fivelvdetailRouter,
	// qjsxdetail:qjsxdetailRouter,
	picshowdetail:picshowdetailRouter,
});

export default reducer;
